        public DataTable Select()
        {
            OleDbConnection conn = new OleDbConnection(myconnecting);
            DataTable dt = new DataTable();
            try
            {
                string sql = "select * From nets";
                OleDbCommand sqlcmd = new OleDbCommand (sql, conn);
                OleDbDataAdapter OleDbDataAdapter = new OleDbDataAdapter(sqlcmd);

                conn.Open();
                OleDbDataAdapter.Fill(dt);
            }
            catch (Exception ex)
            { }
            finally
            {
                conn.Close();
            }
            return dt;
        }
        public bool Insert(nets bd)
        {
            bool isSuccess = false;
            OleDbConnection conn = new OleDbConnection(myconnecting);
            try
            {
                string sql = "INSERT INTO nets(BuildUnitsFrom,BuildUnitsTo,BuildReport,ContractCode,Image,projectPhrase,projectName,periodToImplementProject, implementerCompany,projectOwner,projectrecordingDate,startingProjectDate,projectConsultative, receiptOfTheSite,locationOfCheckingDrillingBottom, projectIndexation) VALUES (@BuildUnitsFrom,@BuildUnitsTo, @BuildReport, @ContractCode, @Image,  @projectPhrase,@projectName,@periodToImplementProject, @implementerCompany,@projectOwner,@projectrecordingDate ,@startingProjectDate,@projectConsultative,  @receiptOfTheSite , @locationOfCheckingDrillingBottom, @projectIndexation)";

                OleDbCommand OleDbCommand = new OleDbCommand (sql, conn);
                //OleDbCommand .Parameters.AddWithValue("@implementerCompany", bd.implementerCompany);
                //OleDbCommand .Parameters.AddWithValue("@[BuildViewUri ]", bd.BuildViewUri);
                OleDbCommand .Parameters.AddWithValue("@BuildUnitsFrom", bd.BuildUnitsFrom);
                OleDbCommand .Parameters.AddWithValue("@BuildUnitsTo", bd.BuildUnitsTo);

                //OleDbCommand .Parameters.AddWithValue("@contractualDate", bd.contractualDate);
                OleDbCommand .Parameters.AddWithValue("@BuildReport", bd.BuildReport);
                OleDbCommand .Parameters.AddWithValue("@ContractCode", bd.ContractCode);
                if (bd.Image == (byte[])null)
                {
                    OleDbCommand .Parameters.AddWithValue("@Image", "");

                }
                else
                {
                    OleDbCommand .Parameters.AddWithValue("@Image", bd.Image);

                }
                //SqlParameter imageParameter = new SqlParameter("@Image", bd.Image);
                //imageParameter.Value = DBNull.Value;
                //OleDbCommand .Parameters.Add(imageParameter);
                OleDbCommand .Parameters.AddWithValue("@projectPhrase", bd.projectPhrase);
                OleDbCommand .Parameters.AddWithValue("@projectName", bd.projectName);
                OleDbCommand .Parameters.AddWithValue("@periodToImplementProject", bd.periodToImplementProject);
                //OleDbCommand .Parameters.AddWithValue("@contractualDate", bd.contractualDate);
                OleDbCommand .Parameters.AddWithValue("@projectOwner", bd.projectOwner);
                OleDbCommand .Parameters.AddWithValue("@implementerCompany", bd.implementerCompany);
                OleDbCommand .Parameters.AddWithValue("@startingProjectDate", bd.startingProjectDate);
                OleDbCommand .Parameters.AddWithValue("@projectrecordingDate", bd.projectrecordingDate);
                OleDbCommand .Parameters.AddWithValue("@projectConsultative", bd.projectConsultative);
                OleDbCommand .Parameters.AddWithValue("@receiptOfTheSite", bd.receiptOfTheSite);
                OleDbCommand .Parameters.AddWithValue("@locationOfCheckingDrillingBottom", bd.locationOfCheckingDrillingBottom);
                // OleDbCommand .Parameters.Add("@projectID", SqlDbType.Int).Value = bd.projectID;
                OleDbCommand .Parameters.AddWithValue("@projectIndexation", bd.projectIndexation);


                conn.Open();

                int rows = OleDbCommand .ExecuteNonQuery();
                if (rows > 0)
                {
                    isSuccess = true;
                }
                else
                {
                    isSuccess = false;
                }
            }
            catch (Exception ex)
            {
                MessageBox.Show("اسم المشروع او رقم العقد متواجد لا يجوز اضافة عقد و مشرو بنفس الاسم" + ' ');
            }
            finally
            {

                conn.Close();
            }
            return isSuccess;
        }
