        public bool Delete(nets bd)
        {
            bool isSuccess = false;
            OleDbConnection conn = new OleDbConnection(myconnecting);
            try
            {
                string sql = "DELETE FROM nets where BuildID=@BuildID";
                OleDbCommand OleDbCommand = new OleDbCommand (sql, conn);
                OleDbCommand .Parameters.AddWithValue("@BuildID", bd.BuildID);

                conn.Open();
                int rows = OleDbCommand .ExecuteNonQuery();
                if (rows > 0)
